CREATE TABLE IF NOT EXISTS FIRMAINCLOUD.DOCUMENT (
	KEY_DOC 	INT AUTO_INCREMENT,
	TYP_DOC 	VARCHAR(1) NOT NULL, 
	NUM_DOC		VARCHAR(80) NOT NULL, 
	ISS_DOC 	VARCHAR(12),
	CITY_DOC 	VARCHAR(1),
	PRIMARY KEY(KEY_DOC)
);

CREATE TABLE FIRMAINCLOUD.VERSIONSW (
	KEY_VER 	INT AUTO_INCREMENT,
	NUM_VER		VARCHAR(8),		-- conterr il numero della versione del sw 
	NOTE_VER 	VARCHAR(512),  
	ISS_DOC 	VARCHAR(12),
	PRIMARY KEY(KEY_VER)
);
 